    root: {
        color: 'white',
    }
})(TextField)

const EditEmployee = () => {
    return (
        <div>
            <Box color='secondary.main'>
                Edit Employee Page
            </Box>
            <form noValidate autoComplete='off'>
                <TextField required id='standard-required' label='First Name' color='secondary' />
            </form>
        </div>
    )
}

export default EditEmployee
